import React from 'react';


function Form() {
  return (
    <div>
      <form method='POST'>
        <input type='text' name='pesquisar' placeholder='Pesquisar'/>
        <button className="btn btn-success">Buscar</button>
      </form> 
   </div>
       );
}

export default Form;
